(4, 'institucional', 'Institucional', 'LEVE O BRASIL COM VOCÊ!', '<h2>História</h2>\r\n<p>A Gosto do Brasil® é uma empresa empreendedora que nasceu em 2010 com o foco de gerar valor ao produto artesanal, cultural e típico brasileiro. Incentivando o turismo e a propagação de conhecimentos gerais sobre o Brasil, seja por meio on-line ou mesmo off-line.</p>\r\n<h2>Negócio</h2>\r\n<p>Empresa de e-commerce voltado para comercialização de produtos típicos brasileiros de valor agregado e proposta inovadora.</p>\r\n<p>Estratégico: presentes com identidade brasileira</p>\r\n<h2>Visão</h2>\r\n<p>Ser a melhor e maior empresa de comercialização de produtos típicos brasileiros de valor agregado e grande incentivadora da valorização do país no mercado mundial.</p>\r\n<h2>Missão</h2>\r\n<p>Encantar clientes através da comercialização de produtos nacionais de qualidade, incentivar o turismo (on-line e off-line) e valorizar a integração regional.</p>\r\n<h2>Objetivos</h2>\r\n<p>-Comercializar os produtos típicos, artesanais e culturais de qualidade do Brasil;<br />-Disseminar a valorização de produtos sócio-ambientais;<br />-Incentivar o turismo (off-line e on-line) através da divulgação das regiões e suas peculiaridades;<br />-Gerar valor agregado ao produto brasileiro aliado à marca Gosto do Brasil. </p>\r\n<h2>Valores</h2>\r\n<p>Marca – Diferencial Competitivo<br />Qualidade – Obrigação<br />Satisfação do Cliente – Principal objetivo<br />Ética – Compromisso com sociedade e meio-ambiente </p>\r\n<h2>Mercado</h2>\r\n<p>Consumidores Virtuais<br />Turistas estrangeiros e nacionais<br />Empresas</p>', NULL, 'institucional.jpg', 1),
(5, 'politica', 'Política de Privacidade', 'Política de Privacidade', '<h2>TERMOS E CONDIÇÕES GERAIS</h2>\r\n<p>Estes Termos e Condições Gerais aplicam-se ao uso dos serviços oferecidos pela Loja Virtual Gosto do Brasil®, quanto à compra de bens comercializados pela empresa Gosto do Brasil Comércio e Exportação LTDA. </p>\r\n<h2>LOJA VIRTUAL GOSTO DO BRASIL®</h2>\r\n<p>A loja foi preparada para oportunizar aos consumidores a compra de produtos típicos brasileiros em destaque, como bebidas, alimentos, chocolates, artesanato, arte, utensílios doméstico, acessórios e outros de forma prática e simples. </p>\r\n<h2>CADASTRO E SIGILO</h2>\r\n<p>Preencha os dados para cadastro conforme solicitado na página. Informe seu e-mail corretamente, pois ele será seu login e escolha uma senha para posteriormente poder finalizar as compras na loja. No caso de esquecimento da sua senha, entre no site e acesse "esqueci minha senha" e preencha as informações solicitadas para que você receba no seu e-mail a confirmação do seu login e senha. Seu cadastro será de uso exclusivo da empresa Gosto do Brasil® &#160;para envio de mercadorias compradas pela loja virtual e envio de ações promocionais. Caso não deseje receber informações sobre promoções contate: contato@gostodobrasil.com.br Na incoerência de algum dado - CPF, RG e número de cartão - automaticamente o sistema reconhecerá como inválido e não validará o cadastro. A empresa está vinculada ao sistema Gateway da Locaweb, o que lhe garante um site totalmente seguro para transações comercias. Portanto os dados de cartão de crédito não são armazenados no banco de dados da Gosto do Brasil. A Gosto do Brasil garante aos seus clientes que todos os dados pessoais registrados no nosso site são confidenciais e em hipótese alguma serão repassados a terceiros. Não forneça seus dados e senhas ou deixe-os disponíveis a terceiros, pois a empresa não se responsabiliza pelo mau uso dos mesmos. </p>\r\n<h2>COMO COMPRAR</h2>\r\n<p>A loja virtual foi desenvolvida com fluxo inteligente e ainda permite encontrar os produtos por marca e descriçã. Apresenta ainda opções de peças vinculadas ao produto escolhido. Após logar-se na loja, você adiciona a quantidade de peças desejadas ao carrinho e ao término da compra finaliza o pedido, informando o CEP da sua cidade para cálculo de frete, escolhe a condição e forma de pagamento e, em seguida, confirma o pedido. Para ter certeza de que sua compra foi efetuada com sucesso você receberá um e-mail na sua caixa postal que confirma a operação. Caso não receba, entre em contato com a empresa (contato@gostodobrasil.com.br) para que a mesma verifique no sistema se houve alguma falha na transmissão das informações. </p>\r\n<h2>PRODUTOS</h2>\r\n<p>Os produtos da Gosto do Brasil são criteriosamente selecionados, através de um controle de qualidade no desenvolvimento de nossos fornecedores. Os produtos serão acondicionados e enviados em embalagens adequadas para sua conservação e proteção. </p>\r\n<h2>FORMAS DE PAGAMENTO</h2>\r\n<p>A empresa oferece a opção de pagamento por cartão de crédito, transferência bancária ou boleto. Observando que a efetivação da compra ocorre quando houver a confirmação do crédito. - Cartões de Crédito VISA e MASTERCARD (Cielo):<br />No processamento do pagamento via cartão de crédito os dados do cartão e da compra são submetidos à operadora e o resultado da autorização é registrado. Em caso de recusa da operadora em aceitar a transação, você terá mais duas chances de processar o pagamento. Após a terceira tentativa sem sucesso, a compra será cancelada. É importante salientar que toda transação é feita na página da própria operadora, ou seja, a Gosto do Brasil não armazena, nem trata dados de cartões de crédito. Recebemos apenas o retorno dizendo se a compra foi aprovada ou não. Todo o processo é 100% seguro. - Transferência on-line Banco do Brasil<br />No caso de transferência online, você será redirecionado ao ambiente do site do banco escolhido, onde fará seu login e processará seu pagamento. Neste caso, você não estará mais no site da Gosto do Brasil®. Após a confirmação da transferência que será informada pelo banco, sua compra será finalizada e seu pedido enviado. - Boleto Banco do Brasil<br />Comprando com pagamento via boleto, o site gerará um boleto com o valor de sua compra e seus dados. O prazo de pagamento é de 3 dias úteis após a data da compra. Para imprimir o boleto, no passo 3 do processo de compra, clique sobre BOLETO BB e depois em próximo passo. Após a confirmação de pagamento que será informada pelo banco, sua compra será finalizada e seu pedido enviado. </p>\r\n<h2>ENVIO DO PEDIDO</h2>\r\n<p>Após a confirmação de pagamento, você receberá um e-mail para acompanhamento do envio da sua compra. As mercadorias serão expedidas apenas em horário comercial (segunda-feira a sexta-feira). Se houver fechamento de um pedido até às 15h, nos dias citados anteriormente, o mesmo será expedido prontamente, caso contrário no dia seguinte (sendo esse dia útil). Pedidos confirmados em feriados e finais de semana (sexta-feira a partir das 15h até domingo) serão expedidos no primeiro dia útil subsequente. O endereço de entrega dos produtos será aquele que foi cadastrado no sistema e a forma de envio utilizado são os Correios na modalidade SEDEX ou PAC. </p>\r\n<h2>PRAZO DE ENTREGA</h2>\r\n<p>A empresa utiliza como envio padrão os Correios para entrega dos pedidos. Por isso, a mesma não se responsabiliza pelo atraso da entrega quando o pedido já estiver em posse dos Correios. O prazo de entrega dos Correios está vinculado à distância da sua cidade em relação à cidade sede da empresa (Caxias do Sul). Você receberá por e-mail o número do conhecimento, fornecido pelos Correios, para acompanhamento da entrega do seu pedido. Caso haja algum atraso ou extravio do seu pedido a empresa deve imediatamente ser contatada para que a mesma entre em contato com os Correios. Consulte outros modos de envio contatando contato@gostodobrasil.com.br </p>\r\n<h2>POLÍTICA DE TROCAS OU DEVOLUÇÕES</h2>\r\n<p>Se no momento da entrega do pedido constatar alguma irregularidade como embalagem ou produto avariado, recuse o mesmo. Confira a quantidade e itens. Caso não ocorra o recebimento correto entre em contato com o nosso Serviço de Atendimento ao Cliente em até 24h, após o recebimento (contato@gostodobrasil.com.br).<br />Será aceito cancelamento de pedido com reembolso total dos valores pagos somente se ainda não tiver sido despachado o mesmo. Caso já tenha sido enviado, solicitamos que sejam devolvidos em sua embalagem, sem violação e o reembolso será feito reduzindo-se o custo de frete. Caso algum produto tenha sido expedido por engano ou trocado em relação ao pedido, devolva-o e avise-nos imediatamente, através dos nossos contatos dispostos no site. Se for comprovado o engano, a empresa fará o estorno do valor pago.<br />A troca ou a devolução do produto somente será aceita mediante a apresentação da respectiva nota fiscal, dentro dos prazos estabelecidos pelo Código de Defesa do Consumidor. No caso de troca ou devolução o produto deve estar em perfeitas condições, sem sinais de uso, com exceção dos produtos com possível defeito de fabricação. Todos os produtos devolvidos com defeito passam por uma avaliação técnica. Nos casos em que for detectada má utilização ou não for constatado o problema mencionado, o produto será devolvido ao cliente sem prévio aviso e sem eventual estorno. </p>\r\n<h2>Código de Defesa do Consumidor</h2>\r\n<p><a href="http://portal.mj.gov.br/DPDC/data/Pages/MJ7E3E5AAEITEMID736B189700174E618C00EF8DA589D98CPTBRNN.htm">http://portal.mj.gov.br/DPDC/data/Pages/MJ7E3E5AAEITEMID736B189700174E618C00EF8DA589D98CPTBRNN.htm</a></p>\r\n<h2>CONTATOS</h2>\r\n<p>contato@gostodobrasil.com.br<br />MSN: vendas.gostodobrasil@hotmail.com ou compras.gostodobrasil@hotmail.com </p>\r\n<h2>HORÁRIO DE ATENDIMENTO ON-LINE</h2>\r\n<p>Segunda a sexta-feira: 8h às 12h e das 13h30min às 17h </p>\r\n<h2>CONDIÇÕES GERAIS </h2>\r\n<p>A Gosto do Brasil Comércio e Exportação LTDA. não se responsabiliza por problemas com serviços terceirizados envolvidos no processo de compra na Loja Virtual Gosto do Brasil, exemplos: greve nos Correios, no sistema bancário, etc.<br />O cadastro do usuário passará por avaliações periódicas para garantir a integridade de todos que utilizam o sistema. <br />Caso ocorra uma compra simultânea por mais de um usuário em um mesmo item, o estoque será debitado a favor do usuário que antes fechar o seu pedido com o item em questão. </p>\r\n<p>Compreendo e aceito os termos descritos acima e desejo utilizar o sistema Loja Virtual Gosto do Brasil. </p>\r\n<h2>TELEFONE: 54-3021-7522</h2>', NULL, NULL, 1),
